            <div className="card col s6 m4 l3 lx2">
                <div className="card-image waves-effect waves-block waves-light">
                    <img className="activator" src={movie.Poster} alt="movie cover" />
                </div>
                <div className="card-content">
                    <span className="card-title activator grey-text text-darken-4">{movie.Title} - {movie.Year}<i class="material-icons right">more_vert</i></span>
                    <p><a href="/">This is a link</a></p>
                </div>
                <div className="card-reveal">
                    <span className="card-title grey-text text-darken-4">Card Title<i class="material-icons right">close</i></span>
                    <p>Here is some more information about this product that is only revealed once clicked on.</p>
                </div>
            </div>
        )
    }
}

export default MovieCard;
